import Radio from '@mui/material/Radio';
import RadioGroup from '@mui/material/RadioGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import FormControl from '@mui/material/FormControl';
import FormLabel from '@mui/material/FormLabel';

export default function FormGroup(props) {
    const {formProps} = props;
    return (
        <div>
            <FormLabel sx={{color : 'black', fontSize : '1.2rem'}}> {formProps.title} </FormLabel>
            <RadioGroup 
                aria-labelledby="demo-radio-buttons-group-label"
                defaultValue={`${formProps.questao}_0`}
                name={formProps.questao}
            >

            <FormControlLabel value={`${formProps.questao}_-1`} FISICA_-1 control={<Radio />} label="Discordo" />
            <FormControlLabel value={`${formProps.questao}_0`} control={<Radio />} label="Tanto faz" />
            <FormControlLabel value={`${formProps.questao}_1`} control={<Radio />} label="Concordo!" />

            </RadioGroup>
        </div>
        );
  }
